def minimum_banknotes(N: str) -> int:
    L = len(N)
    ans = [[0 for _ in range(2)] for _ in range(L)]
    k = int(N[L - 1])
    ans[0][0] = k
    ans[0][1] = 10 + k
    if L > 1:
        for i in range(1, L):
            k = int(N[L - 1 - i])
            ans[i][0] = min(ans[i - 1][0] + k, ans[i - 1][1] + k + 1)
            ans[i][1] = min(ans[i - 1][0] + 10 - k, ans[i - 1][1] + 10 - k - 1)
    return min(ans[L - 1][0], ans[L - 1][1] + 1)

